import { Route, Routes } from 'react-router-dom'
import ModerLogin from '../page/ModerLogin'


export default function Main() {
  return (
    <div>

      <Routes>

        <Route path='/' element={<ModerLogin />} />

        <Route    path='' />

      </Routes>

    </div>
  )
}
